import styled from "styled-components";

export const Container = styled.section`
    position: relative;
    display: flex;
    height: 100vh;
    width: 100%;
    box-sizing: border-box;
    background-size: cover;


    img {
        width: 100%;
        height: 100%;
    }
`;
